<div class="entities" style="line-height: 2.5; direction: ltr">Characterization of the interaction of ingenol 3 - angelate with protein kinase C . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05013
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ( I3A ) is one of the active ingredients in Euphorbia peplus , which has been used in traditional medicine . Here , we report the initial characterization of I3A as a protein kinase C ( PKC ) ligand . I3A bound to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P17252
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 in the presence of phosphatidylserine with high affinity ; however , under these assay conditions , little PKC isoform selectivity was observed . PKC isoforms did show different sensitivity and selectivity for down-regulation by I3A and phorbol 12 - myristate 13 - acetate ( PMA ) in WEHI - 231 , Q9BPY8 - 92 , and Colo - 205 cells . In all of the three cell types , I3A inhibited cell proliferation with somewhat lower potency than did PMA . In intact CHO - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04264
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 cells , I3A was able to translocate different green fluorescent protein-tagged PKC isoforms , visualized by confocal microscopy , with equal or higher potency than PMA . PKC-delta in particular showed a different pattern of translocation in response to I3A and PMA . I3A induced a higher level of secretion of the inflammatory cytokine interleukin 6 compared with PMA in the WEHI - 231 cells and displayed a marked biphasic dose-response curve for the induction . I3A was unable to cause the same extent of association of the C1b domain of PKC-delta with lipids , compared with PMA or the physiological regulator diacylglycerol , and was able to partially block the association induced by these agents , measured by surface plasmon resonance . The in vitro kinase activity of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P17252
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 induced by I3A was lower than that induced by PMA . The novel pattern of behavior of I3A makes it of great interest for further evaluation .</div>

<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">A clinical trial with chimeric monoclonal antibody 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05304
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 and low dose interleukin - 2 pulsing scheme for advanced renal cell carcinoma . PURPOSE : 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05304
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 is a chimeric monoclonal antibody that binds to carbonic anhydrase IX ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q16790
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 / MN ) , which is present on greater than 95 % of RCCs of the clear cell subtype . The suggested working mechanism of 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05304
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 is by ADCC . Because the number of activated ADCC effector cells can be increased by a low dose interleukin - 2 pulsing schedule , a multicenter study was initiated to investigate whether 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05304
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 combined with LD - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P60568
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 could lead to an improved clinical outcome in patients with progressive RCC . MATERIALS AND METHODS : A total of 35 patients with progressive clear cell RCC received weekly infusions of 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05304
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 for 11 weeks combined with a daily LD - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P60568
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 regimen . Patients were monitored longitudinally for ADCC capacity . Radiological assessment of metastatic lesions was performed at week 16 and regularly until disease progression . RESULTS : A durable clinical benefit was achieved in 8 of 35 patients ( 23 % ) , including 3 with a partial response and 5 with stabilization at 24 weeks or greater . Mean survival was 22 months . In general treatment was well tolerated with little toxicity . The number of effector cells increased during treatment but lytic capacity per cell did not increase . ADCC and clinical outcome did not appear to correlate . CONCLUSIONS : 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05304
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 combined with LD - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P60568
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 in patients with metastatic RCC is safe and well tolerated . With a substantial clinical benefit and a median survival of 22 months in patients with metastatic RCC who have progressive disease at study entry combination therapy showed increased overall survival compared to 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05304
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 monotherapy . Survival was at least similar to that of currently used cytokine regimens but with a favorable toxicity profile .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Changes in the phenotype of polymorphic plasma proteins after liver transplantation - new data and medico-legal consequences . The genetically inherited polymorphic plasma protein types have always been considered stable for lifetime in humans . Most of these proteins are synthetised in the liver . Phenotypes for 14 plasma proteins in donors and recipients of liver transplants prior to and after transplantation were determined in 15 patients who had undergone liver transplantation at the university hospitals Charit and Rudolf Virchow in Berlin . The plasma proteins investigated were HP , TF , GC , PI ,

 , FXIIIB , BF ,

 , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<div class="entities" style="line-height: 2.5; direction: ltr">Plasmid DNA adsorbed onto cationic microparticles mediates target gene expression and antigen presentation by dendritic cells . Dendritic cells ( DC ) play a key role in antigen presentation and activation of specific immunity . Much current research focuses on harnessing the potency of DC for vaccines , gene therapy , and cancer immunotherapy applications . However , DC are not readily transfected in vitro by traditional nonviral techniques . A novel DNA vaccine formulation was used to determine if DC are transfected in vitro . The formulation consists of plasmid DNA adsorbed on to cationic microparticles composed of the biodegradable polymer polylactide-co-glycolide (

 - CTAB microparticles to study internalization by macrophages and dendritic cells in vitro and in vivo , we found that most , but not all , of the fluorescence was concentrated in endosomal compartments . Furthermore , uptake of plasmid DNA encoding HIV p55 gag adsorbed to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - CTAB microparticles by murine bone marrow-derived dendritic cells resulted in target gene expression , as detected by RT-PCR . The antigen was subsequently processed and presented , resulting in stimulation of an H - 2kd - restricted , gag-specific T cell hybridoma . Activation of the hybridoma , detected by

 ) and was sustained up to 5 days after transfection . Thus , adsorption of plasmid DNA on
